// SPDX-License-Identifier: MIT
pragma solidity >=0.8.0; 

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "erc721a/contracts/ERC721A.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/Strings.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";
import "@openzeppelin/contracts/utils/cryptography/MerkleProof.sol";

contract DexNft is ERC721A, Ownable, ReentrancyGuard {
  using Strings for uint256;

  string public baseURI;
  string public baseExtension = ".json";
  string public notRevealedUri; 

  uint256 public rate = 10;
  uint256 public wlRate = 10;
  uint256 public maxSupply = 1000;
  uint256 public MaxperWalletwl = 10;
  uint256 public maxPerWallet = 100;
  uint256 public MaxperTx = 5;
  uint256 public Max_Airdrop_Amount_Per_Wallet = 1;
  uint256 public maxAirDropSupply = 100;

  IERC20 public tokenAddress;

  bool public paused = false;
  bool public revealed = true;
  bool public wlMint = false;
  bool public publicMint = true;
  bool public AirdropEnabled = false;

  bytes32 public merkleRoot = 0;

  constructor(
    string memory _initBaseURI,
    address _tokenAddress
  ) ERC721A("DEX BATTLE NFTs", "DEXNFT") {
    setBaseURI(_initBaseURI);
    tokenAddress = IERC20(_tokenAddress);
    
  }

  // internal
  function _baseURI() internal view virtual override returns (string memory) {
    return baseURI;
  }
      function _startTokenId() internal view virtual override returns (uint256) {
        return 1;
    }

  // public
  function PublicMint(uint256 tokens) public nonReentrant {
    require(!paused, "oops contract is paused");
    require(publicMint, "Sale Hasn't started yet");
    uint256 supply = totalSupply();
    require(tokens > 0, "need to mint at least 1 NFT");
    require(tokens <= MaxperTx, "max mint amount per tx exceeded");
    require(supply + tokens <= maxSupply, "We Soldout");
    require(_numberMinted(_msgSender()) + tokens <= maxPerWallet, "Max NFT Per Wallet exceeded");
    

    tokenAddress.transferFrom(msg.sender, address(this), tokens*rate*10**18);
    

      _safeMint(_msgSender(), tokens);
  
    
  }

  // Airdrop nfts for free
    function Airdrop(uint256 tokens) public nonReentrant {
    require(!paused, "oops contract is paused");
    require(AirdropEnabled, "Aidrop Hasn't started yet");
    uint256 supply = totalSupply();
    require(tokens > 0, "need to mint at least 1 NFT");
    require(tokens <= Max_Airdrop_Amount_Per_Wallet, "max mint amount per tx exceeded");
    require(_numberMinted(_msgSender()) + tokens <= Max_Airdrop_Amount_Per_Wallet, "Max NFT Per Wallet exceeded");
    require(supply + tokens <= maxSupply, "We Soldout");
    require(supply + tokens <= maxAirDropSupply, "Airdrop has end");

    

    tokenAddress.transferFrom(msg.sender, address(this), tokens*rate*10**18);
    

      _safeMint(_msgSender(), tokens);
  
    
  }
/// @dev Whitelisted mint for WL addresses
    function WLMint(uint256 tokens, bytes32[] calldata merkleProof) public nonReentrant {
    require(!paused, "oops contract is paused");
    require(wlMint, "WL mint Hasn't started yet");
    require(MerkleProof.verify(merkleProof, merkleRoot, keccak256(abi.encodePacked(msg.sender))), " You are not whitelisted");
    uint256 supply = totalSupply();
    require(_numberMinted(_msgSender()) + tokens <= MaxperWalletwl, "Max NFT Per Wallet exceeded");
    require(tokens > 0, "need to mint at least 1 NFT");
    require(supply + tokens <= maxSupply, "We Soldout");
    require(tokens <= MaxperTx, "max mint per Tx exceeded");

	tokenAddress.transferFrom(msg.sender, address(this), wlRate*10**18);
      _safeMint(_msgSender(), tokens);
    
  }




  /// @dev use it for giveaway and mint for yourself
     function gift(uint256 _mintAmount, address destination) public onlyOwner nonReentrant {
    require(_mintAmount > 0, "need to mint at least 1 NFT");
    uint256 supply = totalSupply();
    require(supply + _mintAmount <= maxSupply, "max NFT limit exceeded");

      _safeMint(destination, _mintAmount);
    
  }

  


  function tokenURI(uint256 tokenId)
    public
    view
    virtual
    override
    returns (string memory)
  {
    require(
      _exists(tokenId),
      "ERC721AMetadata: URI query for nonexistent token"
    );
    
    if(revealed == false) {
        return notRevealedUri;
    }

    string memory currentBaseURI = _baseURI();
    return bytes(currentBaseURI).length > 0
        ? string(abi.encodePacked(currentBaseURI, tokenId.toString(), baseExtension))
        : "";
  }

    function numberMinted(address owner) public view returns (uint256) {
    return _numberMinted(owner);
  }

  //only owner
  function reveal(bool _state) public onlyOwner {
      revealed = _state;
  }

  function setMerkleRoot(bytes32 _merkleRoot) external onlyOwner {
        merkleRoot = _merkleRoot;
    }
  

    function setMaxperWalletwl(uint256 _limit) public onlyOwner {
    MaxperWalletwl = _limit;
  }

    function setMaxperWallet(uint256 _limit) public onlyOwner {
    maxPerWallet = _limit;
  }

  function setMaxAirDropSupply(uint256 _maxAirDropSupply) public onlyOwner{
    maxAirDropSupply = _maxAirDropSupply;
  }

  function setMax_Airdrop_Amount_Per_Wallet(uint256 _NewMaxAirdrop)public onlyOwner {
     Max_Airdrop_Amount_Per_Wallet = _NewMaxAirdrop;
  }
  
  function setRate(uint256 _newRate) public onlyOwner {
    rate = _newRate;
  }

function setWlRate(uint256 _newWlRate) public onlyOwner {
    wlRate = _newWlRate;
  }

function setMaxperTx(uint256 _newMaxperTx) public onlyOwner {
    MaxperTx = _newMaxperTx;
  }


    function setMaxsupply(uint256 _newsupply) public onlyOwner {
    maxSupply = _newsupply;
  }

 
  function setBaseURI(string memory _newBaseURI) public onlyOwner {
    baseURI = _newBaseURI;
  }

  function setBaseExtension(string memory _newBaseExtension) public onlyOwner {
    baseExtension = _newBaseExtension;
  }
  
  function setNotRevealedURI(string memory _notRevealedURI) public onlyOwner {
    notRevealedUri = _notRevealedURI;
  }

  function pause(bool _state) public onlyOwner {
    paused = _state;
  }

  function toggleAirdropEnabled(bool _state) public onlyOwner {
    AirdropEnabled = _state;
  }

    function toggleWlMint(bool _state) external onlyOwner {
        wlMint = _state;
    }

    function togglepublicMint(bool _state) external onlyOwner {
        publicMint = _state;
    }
  
 
  function withdrawToken() public onlyOwner {
        tokenAddress.transfer(msg.sender, tokenAddress.balanceOf(address(this)));
    }
}

